import DeleteIcon from "@material-ui/icons/Delete"
import EditIcon from "@material-ui/icons/Edit"
import React from "react";
import { Box, Button, makeStyles, TableRow } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  button: {
    margin: theme.spacing(1),
  },
}));

const EntryItem = ({ id, catagorie, amount,  }) => {
  const classes = useStyles();
  return (
    <Box display="flex">
      <Box display="flex" >
        <Box> {catagorie} </Box>
        <Box> {amount} </Box>
      </Box>

      <Box>
        <Button
          variant="contained"
          color="primary"
          className={classes.button}
          startIcon={<EditIcon />}
        >
          Edite
        </Button>
        <Button
          variant="contained"
          color="secondary"
          className={classes.button}
          startIcon={<DeleteIcon />}
        >
          Delete
        </Button>
      </Box>
      <TableRow key={catagorie}>

      </TableRow>
    </Box>
  );
};

export default EntryItem;
